import Nav from './views/Nav'  
import axios from "axios";
import './App.css';

function App() {

  const [data, setData] = useState([])
  const options = {
    method: 'GET',
    url: 'https://random-stuff-api.p.rapidapi.com/image/dog',
    params: {api_key: '<REQUIRED>'},
    headers: {
      'x-rapidapi-key': 'cc687eba84mshcc7485fcf110baap193a15jsnfb1be463a74d',
      'x-rapidapi-host': 'random-stuff-api.p.rapidapi.com'
    }
  };

  useEffect(() => {
    axios
    .request(options)
    .then(function (res) {
      setData(res.data)
      console.log(res.data);
    }).catch(function (err) {
      console.error(err);
    });
  }, [true])


  return (
    <div className="App">
      <Nav data={data}/>
      This is the App
    </div>
  );
}

export default App;
